    def test_nouns_parser_should_parse_token(self):
        fetcher = MetadataFetcher()
        contract_caller = ContractCaller()
        parser = NounsParser(fetcher=fetcher, contract_caller=contract_caller)
        assert parser.should_parse_token(token=self.token)

